import ClassicHeading1 from '../components/user/classic/ClassicHeading1'
import ClassicHeading2 from '../components/user/classic/ClassicHeading2'
import ClassicHome1 from '../components/user/classic/ClassicHome1'
import ModernHeading1 from '../components/user/modern/ModernHeading1'

export default {
  ClassicHeading1: { component: ClassicHeading1, thumbnail: { name: 'classic-home-1-thumbnail.jpg', height: '100px' } },
  ClassicHeading2: { component: ClassicHeading2, thumbnail: { name: 'classic-home-1-thumbnail.jpg', height: '100px' } },
  ClassicHome1: { component: ClassicHome1, thumbnail: { name: 'classic-home-1-thumbnail.jpg', height: '100px' } },
  ModernHeading1: { component: ModernHeading1, thumbnail: { name: 'classic-home-1-thumbnail.jpg', height: '100px' } }
}
